import { Col, Row, Space } from "antd";
import { useState } from "react";
import TodoList from "widgets/TodoList/ui/TodoList";
import TodoNavbar from "widgets/TodoNavbar/ui/TodoNavbar";

const TodoMain = () => {
    const { val: string, setVal: any } = useState<string>("");

    return (
        <Row
            justify="center"
            align="middle"
            style={{
                position: "absolute",
                top: 0,
                bottom: 0,
                right: 0,
                left: 0,
            }}
        >
            <Col span={12}>
                <TodoNavbar val={val} setVal={setVal} />
                <TodoList />
            </Col>
        </Row>
    );
};
export default TodoMain;
